import{_ as e,a as t,b as a,c as i,d as r,e as n}from"./chunks/holybro_gps_dimensions.ILYW1v1q.js";import{_ as l,c as s,a8 as c,o as p}from"./chunks/framework.BDnHobkS.js";const P=JSON.parse('{"title":"Holybro M8N & M9N GPS","description":"","frontmatter":{},"headers":[],"relativePath":"ko/gps_compass/gps_holybro_m8n_m9n.md","filePath":"ko/gps_compass/gps_holybro_m8n_m9n.md"}'),h={name:"ko/gps_compass/gps_holybro_m8n_m9n.md"};function d(m,o,u,b,f,S){return p(),s("div",null,o[0]||(o[0]=[c('<h1 id="holybro-m8n-m9n-gps" tabindex="-1">Holybro M8N &amp; M9N GPS <a class="header-anchor" href="#holybro-m8n-m9n-gps" aria-label="Permalink to &quot;Holybro M8N &amp; M9N GPS&quot;">​</a></h1><p>The GPS includes either a M8N or M9N UBLOX module, IST8310 compass, tri-colored LED indicator, and a safety switch.</p><p>There are 3 different connector options, allowing easy connection to flight controllers that are compliant with the Pixhawk-connector standard as either a primary or secondary GPS. This module ships with a baud rate of 38400 Hz.</p><p>The main difference between the modules is that the M8N allows concurrent reception of up to 3 GNSS systems, while M9N can concurrently connect to up to 4.</p><p><img src="'+e+'" width="200px" title="holybro_gps"> <img src="'+t+'" width="215px" title="holybro_gps"></p><h3 id="features-and-specifications" tabindex="-1">Features and Specifications <a class="header-anchor" href="#features-and-specifications" aria-label="Permalink to &quot;Features and Specifications&quot;">​</a></h3><ul><li>Ublox Neo-M8N or M9N module</li><li>Industry leading –167 dBm navigation sensitivity</li><li>Cold starts: 26s</li><li>LNA MAX2659ELT+</li><li>25 x 25 x 4 mm ceramic patch antenna</li><li>Rechargeable Farah capacitance</li><li>Low noise 3.3V regulator</li><li>Current consumption: less than 150mA @ 5V</li><li>Fix indicator LEDs</li><li>Protective case</li><li>26cm cable included</li><li>Diameter: 50mm total size, 32 grams with case.</li><li><strong>M8N:</strong> Concurrent reception of up to 3 GNSS (GPS, Galileo, GLONASS, BeiDou)</li><li><strong>M9N:</strong> Concurrent reception of up to 4 GNSS (GPS, Galileo, GLONASS, BeiDou)</li></ul><h2 id="구매처" tabindex="-1">구매처 <a class="header-anchor" href="#구매처" aria-label="Permalink to &quot;구매처&quot;">​</a></h2><ul><li><a href="https://holybro.com/collections/gps" target="_blank" rel="noreferrer">Holybro</a></li></ul><p>Note that there are variants for both M8N and M9N and also three different connectors.</p><h2 id="배선" tabindex="-1">배선 <a class="header-anchor" href="#배선" aria-label="Permalink to &quot;배선&quot;">​</a></h2><p>Both the M8N and M9N GPS modules come in three variants. These allow out-of-the box connection to flight controllers that follow the Pixhawk connector standard as either a primary or secondary GPS.</p><ul><li><p><strong>SKU12012 Holybro M8N GPS (JST GHR1.25mm 10 pin cable)</strong>.</p><p>This JST GH 10Pin connector can be used on Pixhawk Series 10pin <code>GPS Module</code> or <code>GPS1</code> input port.</p><p><img src="'+a+'" alt="Holybro M8N with Pixhawk GPS1 connector"></p></li><li><p><strong>SKU12014 Holybro M8N 2nd GPS (JST GHR1.25m m 6pin cable)</strong></p><p>This JST GH 6Pin connector can be used on Pixhawk Series 6pin <code>UART</code>, <code>I2C</code> or <code>GPS2</code> input port as secondary GPS.</p><p><img src="'+i+'" alt="Holybro M8N with Pixhawk 2nd GPS connector"></p></li><li><p><strong>SKU12013 Holybro M8N GPS for Pix32 (Molex 1.25mm 6pin &amp; 4pin &amp; 3pin cable)</strong></p><p>These Molex 1.25mm 6pin &amp; 4pin &amp; 3pin connectors are for the <a href="./../flight_controller/holybro_pix32.html">Holybro pix32 Flight Controller</a> <code>Switch</code>, <code>GPS</code>, and <code>I2C</code> input ports (not for the Pix32 v5 or v6).</p><p><img src="'+r+'" alt="Holybro M8N with Pix32 connector"></p></li></ul><h2 id="크기" tabindex="-1">크기 <a class="header-anchor" href="#크기" aria-label="Permalink to &quot;크기&quot;">​</a></h2><p><img src="'+n+'" alt="Image showing dimensions of both modules"></p>',15)]))}const N=l(h,[["render",d]]);export{P as __pageData,N as default};
